import React from "react";
import "./App.css";

import MyHeader from "./MyHeader";
import Counter from "./Counter";

function App() {
  const number = 5;

  const counterProps = {
    a: 1,
    b: 2,
    c: 3,
    d: 4,
    e: 5,
    initialValue: 5,
  };

  return (
    <div>
      <MyHeader />
      <Counter a={1} b={2} c={3} d={4} e={5} initialValue={5} />
    </div>
  );
}

export default App;
